import React from "react";
import { Card, Popover } from "antd";
import {
    RetweetOutlined,
    HeartOutlined,
    MessageOutlined,
    EllipsisOutlied,
} from "@ant-design";

const PostCard = ({ post }) => {
    return (
        <div>
            <Card
                cover={post.Images[0] && <PostImages images={post.Images} />}
                actions={[
                    <RetweetOutlined key="retweet"/>,
                    <HeartOutlined key="heart"/>,
                    <MessageOutlined />,
                    <Popover>
                        <EllipsisOutlied />
                    </Popover>,
                ]}
            >
                <Image />
                <Content />
                <Buttonss></Buttonss>
            </Card>
            <CommentForm />
            <Comments />
        </div>
    );
};

export default PostCard;
